 \
local function romanize(k)\
  str = \"\"\
  k = k + 0\
  for _, v in ipairs(romans) do --note that this is -not- ipairs.\
    val, let = unpack(v)\
    while k >= val do\
      k = k - val\
      str = str..let\
    end\
  end\
  return str\
end\
