  col = 1\
  lastpos = 0\
  linecache = { { lno = 1, pos = 1} }\
end\
\
local function getline( s, p )\
  start = 1\
  lno = 1\
  if p > lastpos then\
    lno = linecache[#linecache].lno \
    start = linecache[#linecache].pos + 1\
    col = 1\
  else\
