    else\
        -- Some variant of Windows BITMAPINFOHEADER with 32 bit width & height.\
        return Util.get_uint32_le(buf, 19), Util.get_uint32_le(buf, 23),\
               MIME_TYPE\
    end\
end\
\
return size\
-- vi:ts=4 sw=4 expandtab\
"
, '@'..".\\lua-libraries\\imagesize\\format\\bmp.lua" ) )

