    for i,node in pairs(self.nodes) do\
      if initial and (node:isGlue() or node:isPenalty()) then\
        -- do nothing\
      else\
        initial = false\
        node:outputYourself(typesetter, self)\
      end\
    end\
    typesetter.frame:moveY(self.depth)\
    typesetter.frame:newLine()\
  end  \
